class Node:
    def __init__(self, value):
        self.value = value
        self.next = None

class SortedLinkedList:
    def __init__(self):
        self.head = None

    def insert(self, value):
        new_node = Node(value)
        if self.head is None or self.head.value >= value:
            new_node.next = self.head
            self.head = new_node
        else:
            current = self.head
            while current.next is not None and current.next.value < value:
                current = current.next
            new_node.next = current.next
            current.next = new_node

    def search(self, value):
        return self.binary_search(value, self.head)

    def binary_search(self, value, start):
        if start is None:
            return False
        if start.value == value:
            return True
        elif start.value < value:
            return self.binary_search(value, start.next)
        else:
            return False

    def display(self):
        current = self.head
        while current:
            print(current.value, end=" -> ")
            current = current.next
        print("None")


