class Node:
    def __init__(self, value):
        self.value = value
        self.next = None

class TwoLinkedLists:
    def __init__(self):
        self.express_head = None
        self.local_head = None

    def insert_express(self, value):
        new_node = Node(value)
        if self.express_head is None or self.express_head.value >= value:
            new_node.next = self.express_head
            self.express_head = new_node
        else:
            current = self.express_head
            while current.next is not None and current.next.value < value:
                current = current.next
            new_node.next = current.next
            current.next = new_node

    def insert_local(self, value):
        new_node = Node(value)
        if self.local_head is None or self.local_head.value >= value:
            new_node.next = self.local_head
            self.local_head = new_node
        else:
            current = self.local_head
            while current.next is not None and current.next.value < value:
                current = current.next
            new_node.next = current.next
            current.next = new_node

    def link_common_nodes(self, common_values):
        current_express = self.express_head
        current_local = self.local_head

        while current_express is not None and current_local is not None:
            if current_express.value == current_local.value and current_express.value in common_values:
                current_express.next = current_local
            current_express = current_express.next
            current_local = current_local.next

    def search(self, value):
        current_express = self.express_head
        while current_express and current_express.value < value:
            current_express = current_express.next

        if current_express and current_express.value == value:
            return True

        current_local = self.local_head
        while current_local and current_local.value < value:
            current_local = current_local.next

        if current_local and current_local.value == value:
            return True

        return False

    def display_express(self):
        current = self.express_head
        while current:
            print(current.value, end=" -> ")
            current = current.next
        print("None")

    def display_local(self):
        current = self.local_head
        while current:
            print(current.value, end=" -> ")
            current = current.next
        print("None")


