class Node:
    def __init__(self, is_leaf=False):
        self.keys = []
        self.children = []
        self.is_leaf = is_leaf

class LGNSortedLinkedLists:
    def __init__(self):
        self.root = Node(is_leaf=True)

    def insert(self, value):
        self._insert(value, self.root)

    def _insert(self, value, node):
        if node.is_leaf:
            self.insert_into_leaf(value, node)
        else:
            i = len(node.keys) - 1
            while i >= 0 and value < node.keys[i]:
                i -= 1
            i += 1
            if len(node.children) > i:
                self._insert(value, node.children[i])
            else:
                new_node = Node(is_leaf=True)
                self._insert(value, new_node)
                node.children.insert(i, new_node)
                node.keys.insert(i, new_node.keys[0])

            if len(node.keys) > 2:  # Split node if necessary
                mid = len(node.keys) // 2
                new_child = Node()
                new_child.keys = node.keys[mid + 1:]
                new_child.children = node.children[mid + 1:]
                new_node = Node(is_leaf=False)
                new_node.keys = [node.keys[mid]]
                new_node.children = [node, new_child]
                node.keys = node.keys[:mid]
                node.children = node.children[:mid + 1]
                node.is_leaf = False
                node.children[1] = new_child

    def insert_into_leaf(self, value, node):
        i = len(node.keys) - 1
        while i >= 0 and value < node.keys[i]:
            i -= 1
        node.keys.insert(i + 1, value)

    def search(self, value):
        return self._search(value, self.root)

    def _search(self, value, node):
        if node.is_leaf:
            return value in node.keys
        else:
            i = len(node.keys) - 1
            while i >= 0 and value < node.keys[i]:
                i -= 1
            i += 1
            if len(node.children) > i:
                return self._search(value, node.children[i])
            else:
                return False

    def display(self):
        self._display(self.root)

    def _display(self, node, level=0):
        print("Level", level, ":", node.keys)
        if not node.is_leaf:
            for child in node.children:
                self._display(child, level + 1)


